import struct

hexs = ""  # tu string completo

# 1) sanity: hex par
print("nibbles:", len(hexs), "par?", len(hexs)%2==0)

b = bytes.fromhex(hexs)
print("bytes:", len(b), "par?", len(b)%2==0, "ultimos2:", b[-2:].hex())

def xor16_le(bb):
    cs=0
    for i in range(0, len(bb), 2):
        cs ^= struct.unpack_from('<H', bb, i)[0]
    return cs

print("XOR total LE:", f"{xor16_le(b):04x}")
